package JavaProgram;
class Prj{
	 int num;
	 String name;
	Prj()
	{
		System.out.println("Prajwal");
	}
}

public class Constructor2a {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Prj p=new Prj();
		System.out.println(p.num);
		System.out.println(p.name);
	}

}